        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>By the end of this section you will understand how data processing happens under the hood.&lt;/li>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>You will understand how snowflake architecture layers will interact&lt;/li>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>  with each other.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>You will understand how caching works in snowflake.&lt;/li>&lt;/ul>&lt;/body>">
            <use transform="translate(146,5)" xlink:href="#imgnote"/>
        </g>
    </g>
    <g id="148" ed:height="24" ed:parentid="145" transform="matrix(1,0,0,1,1177.49,371.58)" ed:width="359.1875">
        <text class="st12">
            <tspan textLength="314" x="10" y="17.5" style="white-space:pre">[Architecture demo] Caching in snowflake.(18:19)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In this lecture we will discuss about how &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>snowflake architectural layers will interact with each other.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We will submit query to snowflake and check,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>1. How execution will flow from CLOUD SERVICE LAYER &lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>to VIRTUAL WAREHOUSE LAYER and DATA STORAGE LAYER.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>2. We will see how CLOUD SERVICE LAYER will reuse the query results.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>3. We will disable CLOUD SERVICE layer CACHE and check how VIRTUAL warehouse layer cache is being utilized.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>4. Once VIRTUAL warehouse is suspended it's cached results will be lost.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>5. We discussed about, RESULT CACHE, LOCAL DISK CACHE and REMOTE DISK CACHE&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(330,5)" xlink:href="#imgnote"/>
        </g>
    </g>
    <g id="150" ed:height="24" ed:parentid="145" transform="matrix(1,0,0,1,1177.49,405.33)" ed:width="322.1875">
        <text class="st12">
            <tspan textLength="277" x="10" y="17.5" style="white-space:pre">[Architecture demo] Caching revisit.(03:47)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We will sumarize on ,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>STEP 1 : &lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Step one We created extra small size warehouse and we executed Query Select Star from Supplier.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>When we executed this query, we saw how data got pulled from data storage layer to virtual warehouse&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>layer, and we saw how Result got returned to the cloud services layer.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>STEP 2 :&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In step two, we executed same query again and we saw query got returned within few milliseconds.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Here we saw that cloud services layer result cache is being reused.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We also saw no data processing happened.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>STEP 3:&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In step three, we disabled cloud service cache and we expected query to use virtual warehouse layer&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>caching area.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>But Query ran for a long time.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Reason for this was our virtual warehouse went to suspended state so virtual warehouse cache was burst&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>STEP 4 :&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Here, we again executed the same query.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Now when we check the profile page, query used 100% of local disk cache query took long time to return&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>as it is again processing the data and it is again writing the result back to the cloud services layer.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>You might ask one curious question here we are just executing a simple select star from query,&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;> &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>what kind of processing it is doing in the virtual warehouse layer ?&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>You can observe from step four we have used 100% of local disk cache.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We have used 100% of local disk cash, even though 62% of the time is spent on processing.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>What is happening here is data stored in data storage layer will be in column compressed and it will&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>end.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>It will be in encrypted format.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>When this data is pulled inside virtual warehouse layer, it will be uncompressed and stored on virtual&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>warehouse local hard disk, which we call as local disk cache.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>But encrypted data will be decrypted only in memory of virtual warehouse while files are being read&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>from this virtual warehouse nodes.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Once the files are read, it should again get encrypted and it will be sent over the network to cloud&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>services layer.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>This whole process of decrypting the files, encrypting it again and sending it over the network took&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>62% of the processing time&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(293,5)" xlink:href="#imgnote"/>
        </g>
    </g>
    <g id="152" ed:height="24" ed:parentid="145" transform="matrix(1,0,0,1,1177.49,439.08)" ed:width="328.875">
        <text class="st12">
            <tspan textLength="284" x="10" y="17.5" style="white-space:pre">[Architecture demo] Lessons learned.(03:47)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&amp;gt; You always need virtual warehouse to execute queries.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&amp;gt; Don't run select * queries in snowflake. Always use LIMIT clause.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&amp;gt; During developmet activities always keep auto suspend time to a higher limit.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&amp;gt; Share your warehouse when group of users are working on the common tables.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&amp;gt; Never disable your cloud service layer cache result.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;/body>">
            <use transform="translate(300,5)" xlink:href="#imgnote"/>
        </g>
    </g>
    <g id="154" ed:height="24" ed:parentid="145" transform="matrix(1,0,0,1,1177.49,472.83)" ed:width="174.328125">
        <text class="st12">
            <tspan textLength="129" x="10" y="17.5" style="white-space:pre">Clarifications(08:30)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>What if underlying table get updated ?&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>  When change happens in the table, data will be again fetched from the DATA STORAG E LAYER.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>If you want to make any changes to the table, run your all update delete trancations at once. After that you can run your select queries.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>If multiple users using same roles runs similar queries then CLOUD SERVICE LAYER CACHE will be reused.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Result will be stored in CLOUD SERVICE LAYER for 24hrs.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(145,5)" xlink:href="#imgnote"/>
        </g>
    </g>

    <g id="167" ed:height="24" ed:parentid="156" transform="matrix(1,0,0,1,99.83,875.83)" ed:width="357.015625">
        <text class="st12">
            <tspan textLength="291" x="10" y="17.5" style="white-space:pre">[Demo] Applying clustering brief intro.(05:45)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In this lecture we will discuss about applying clusterig to snowflake TABLE.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We will discuss about SYNTAX&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Clustering keys are not intended for all tables&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>The size of a table, as well as the query performance for the table, should dictate whether to define a clustering key for the table.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Table has to be large enough to consist of a sufficiently large number of micro-partitions, and the column(s) defined in the clustering key have to provide sufficient filtering to select a subset of these micro- partitions.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In general, tables in the multi-terabyte (TB) range will experience the most benefit from clustering, particularly if DML is performed regularly/continually on these tables.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(328,5)" xlink:href="#imgnote"/>
        </g>
        <g ed:hyperlink="[&#xa;    {&#xa;        &quot;desc&quot;: &quot;Apply clustering&quot;,&#xa;        &quot;link&quot;: &quot;https://www.udemy.com/course/snowflake-cloud-data-warehouse/learn/lecture/18256902#overview&quot;&#xa;    }&#xa;]&#xa;">
            <use transform="translate(307,5)" xlink:href="#imghyperlink"/>
        </g>

ied you can use below command,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>     SELECT SYSTEM$CLUSTERING_INFORMATION('CUSTOMER_CLUSTERED','(C_MKTSEGMENT)');&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>     SELECT SYSTEM$CLUSTERING_INFORMATION('CUSTOMER_CLUSTERED','(C_MKTSEGMENT,C_CUST_KEY)');&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;/body>">

    <g id="182" ed:height="24" ed:parentid="169" transform="matrix(1,0,0,1,707.13,909.58)" ed:width="358.015625">
        <text class="st12">
            <tspan textLength="292" x="10" y="17.5" style="white-space:pre">[Demo] How to choose clustering keys.(04:28)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Columns which are more often used in where clause.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Columns which are more often used in join conditions.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&#x9;SELECT A.EMP_DEPT, B. EMP_NAME&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&#x9;FROM EMP B, DEPT A&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&#x9;WHERE B.DEPT_ID = A.DEPT_ID&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Order you specify clustering key is important. As general rule, Snowflake recommends ordering the columns from &lt;/span>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt; font-weight:600;&quot;>lowest cardinality to highest cardinality&lt;/span>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(329,5)" xlink:href="#imgnote"/>
        </g>

        </g>

    <g id="195" ed:height="24" ed:parentid="188" transform="matrix(1,0,0,1,75.9,1419.6)" ed:width="197">
        <text class="st12">
            <tspan textLength="131" x="10" y="17.5" style="white-space:pre">Scaling policy(03:30)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:15pt; font-weight:600; color:#000000;&quot;>1. what is the trigger to suspend a cluster if no load is present?&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:19pt; color:#394f60;&quot;>Scaling policy&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:19pt; color:#394f60;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>STANDARD:&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:15pt; color:#000000;&quot;>After 2 to 3 consecutive successful checks (performed at 1-minute intervals), which determine    whether the load on the least-loaded cluster could be redistributed to the other clusters without spinning up the cluster again.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:15pt; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>ECONOMY:&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:15pt; color:#000000;&quot;>After 5 to 6 consecutive successful checks (performed at 1-minute intervals), which determine whether the load on the least-loaded cluster could be redistributed to the other clusters without spinning up the cluster again.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Arial'; font-size:16pt; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; font-weight:600; color:#000000;&quot;>2. How many queries does snowflake queues before it spins up additional cluster?&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:16pt; font-weight:600; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>STANDARD:&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:16pt; font-weight:600; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>Immediately when either a query is queued, or the system detects that &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>there’s one more query than the currently-running clusters can execute.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>ECONOMY:&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:16pt; color:#000000;&quot;>Only if the system estimates there’s enough query load to keep the cluster busy for at least 6 minutes&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(168,5)" xlink:href="#imgnote"/>
        </g>

nt-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Using hints to tune Oracle SQL&lt;/li>&lt;/ul>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Performance tuning in snowflake means,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>How sensibly you use this tool.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Which helps to reduce processing cost.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Which helps to reduce storage cost.&lt;/li>&lt;/ul>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Points to consider while performance/Cost tuning,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>SELECT * FROM EMP;&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>SELECT EMP_NAME, EMP_ADDR FROM EMP;&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Sharing virtual warehouse while dev activities.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Order your data by filter columns during data loading process.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Use multi cluster warehouse instead of spinning up existing cluster to bigger size.&lt;/li>&lt;/ul>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In snowflake we don't have,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>There is no concept of index.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>No concept of primary key, foreign key constraints.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>No need of transaction management.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>There is no buffer pool.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>You will never encounter out of memory exception.&lt;/li>&lt;/ul>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In snowflake we have only NOT NULL  constraint&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(348,5)" xlink:href="#imgnote"/>
        </g>
        <g ed:hyperlink="[&#xa;    {&#xa;        &quot;desc&quot;: &quot;Performance tuning&quot;,&#xa;        &quot;link&quot;: &quot;https://www.udemy.com/course/snowflake-cloud-data-warehouse/learn/lecture/18157710#overview&quot;&#xa;    }&#xa;]&#xa;">
            <use transform="translate(327,5)" xlink:href="#imghyperlink"/>
        </g>
    </g>
    <g id="202" ed:height="24" ed:parentid="197" transform="matrix(1,0,0,1,95.71,1895.99)" ed:width="305.34375">
        <text class="st12">
            <tspan textLength="239" x="10" y="17.5" style="white-space:pre">How query optimization works.(04:10)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Query will go through below steps ,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Parsing.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Object resolution.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Access control.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Plan optimization.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Snowflake will not use indexes.&lt;/li>&lt;/ul>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Index is good for transactional system, but for system like Snowflake it will raise multiple challenge.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Storage medium in snowflake is s3 and data format is compressed files.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Maintaining indexes significantly increases volume of data and data loading time.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>User need to explicitly create indices. Which goes against snowflake philosophy of SAS.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Maintaining indices can be complex, expensive and risky process.&lt;/li>&lt;/ul>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Instead of using INDEX snowlake will use,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;ul style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Pruning.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Zone maps.&lt;/li>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>Data skipping.&lt;/li>&lt;/ul>&lt;/body>">
            <use transform="translate(276,5)" xlink:href="#imgnote"/>
        </g>
        <g ed:hyperlink="[&#xa;    {&#xa;        &quot;desc&quot;: &quot;Optimization&quot;,&#xa;        &quot;link&quot;: &quot;https://www.udemy.com/course/snowflake-cloud-data-warehouse/learn/lecture/18157716#overview&quot;&#xa;    }&#xa;]&#xa;">
            <use transform="translate(255,5)" xlink:href="#imghyperlink"/>
        </g>
    </g>
    <g id="204" ed:height="24" ed:parentid="197" transform="matrix(1,0,0,1,95.71,1929.74)" ed:width="242.546875">
        <text class="st12">
            <tspan textLength="177" x="10" y="17.5" style="white-space:pre">Concurrency control.(15:28)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In this lecture we will see how concurrency control works,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>1. We discuss by taking an example  we will fire 2 update queries on the table and check how concurrency control works.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>2. You can drop the table, while update is running because DROP is a DML operation. If user has right permission he can drop the table.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>3. You can trigger a query to read data from the table and immediatly drop the table. In that case the read operation will still complete successfully.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>4. We understand about SNAPSHOT ISSOLATION and how it's helping to achive ACID transactions in snowflake.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(213,5)" xlink:href="#imgnote"/>
        </g>
        <g ed:hyperlink="[&#xa;    {&#xa;        &quot;desc&quot;: &quot;Concurrency control&quot;,&#xa;        &quot;link&quot;: &quot;https://www.udemy.com/course/snowflake-cloud-data-warehouse/learn/lecture/18157718&quot;&#xa;    }&#xa;]&#xa;">
            <use transform="translate(192,5)" xlink:href="#imghyperlink"/>
        </g>
    </g>
    <g id="206" ed:height="24" ed:parentid="197" transform="matrix(1,0,0,1,95.71,1963.49)" ed:width="357.1875">
        <text class="st12">

mily:'Comic Sans MS'; font-size:10pt;&quot;>  more than 80% of records are getting impacted, then instead of executing update you can consider recreating whole table.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>You can execute delete and insert statement separately.&lt;/li>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;li style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>When you are trying to update or delete try considering numeric columns as its easy to scan micro- partitions.&lt;/li>&lt;/ul>&lt;/body>">

        </g>

    <g id="208" ed:height="24" ed:parentid="197" transform="matrix(1,0,0,1,95.71,1997.24)" ed:width="259.515625">
        <text class="st12">
            <tspan textLength="194" x="10" y="17.5" style="white-space:pre">[Demo] No constraints.(04:19)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In snowflake we don't have Unique or primary key constraints.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Even though you can mention constraints those constraints are not &lt;/span>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt; font-weight:600;&quot;>ENFORCED&lt;/span>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Only NOT NULL constraint is ENFORCED in snowflake.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(230,5)" xlink:href="#imgnote"/>
        </g>
        <g ed:hyperlink="[&#xa;    {&#xa;        &quot;desc&quot;: &quot;No constraints&quot;,&#xa;        &quot;link&quot;: &quot;https://www.udemy.com/course/snowflake-cloud-data-warehouse/learn/lecture/18167548#overview&quot;&#xa;    }&#xa;]&#xa;">
            <use transform="translate(209,5)" xlink:href="#imghyperlink"/>
        </g>
    </g>

        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In this lecture we will try to answer these questions,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>What if I abort query while executing will its rollback partially updated data?&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>How to kill blocked transactions?&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>What happens if I execute update statement on different columns as two&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>separate transaction?&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>How long queries will queue up?&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(90,5)" xlink:href="#imgnote"/>
        </g>
    </g>

    <g id="252" ed:height="24" ed:parentid="249" transform="matrix(1,0,0,1,585.71,1862.24)" ed:width="190.328125">
        <text class="st12">
            <tspan textLength="124" x="10" y="17.5" style="white-space:pre">Introduction(01:20)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>• The query acceleration service can accelerate(parts of the query workload in a warehouse. When it is enabled for a warehouse, it can improve overall warehouse performance by reducing the impact of outlier queries, which are queries that use more resources than the typical query.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;> The query acceleration service does this by offloading portions of the query processing work to shared compute resources that are provided by the service.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>• The query acceleration service can handle workloads more efficiently by&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>performing more work in parallel and reducing the wallclock time spent in scanning and filtering.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(161,5)" xlink:href="#imgnote"/>
        </g>

            <use transform="translate(140,5)" xlink:href="#imghyperlink"/>

        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In this lecture&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>&amp;gt; You can scale virtual warehouse horizontally dynamically.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>• But you can't scale virtual warehouse vertically.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Scalling virtual warehouse horizontally can reduce query queue time.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>But to increase query performance you need to scale up virtual warehouse horizontally.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Arial';&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Some times this can cause resource under utilization.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;img src=&quot;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAiEAAAEkCAIAAAB2UHb+AAAACXBIWXMAAAsTAAALEwEAmpwYAAAgAElEQVR4nOy9eXxVxf3//37PnLtlT8hCQgghYQsBAglZ2HdEUEDZ3K3a9mPVVqu2/bSfPqptH+3Ppa21H/VTWvWrFUTZEdl3SFjDDgmBBAhZSEL29S7nzPv3x5x7ExCVJRvhPB8KJLk3Z+6ZOfOaeW+DQggwMDAwMDBoA1hHN8DAwMDAoMtiaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVthaIyBgYGBQVuhdHQDDAwM2g+Xy3X58uWqqipE7NatW/fu3TnnLV9AREVFRZWVlRaLpUePHj4+Ph3VVIOugaExBgZ3BUKII0eOfPzxx3v37q2pqUFEf3//SZMm/fjHP+7Tpw9jjIicTue777775Zdf1tXVcc6HDh3661//esiQIR3ddoM7GBRCdHQbDAwM2hYi2rt3789//vPi4uKJEycmJycTUXp6+vbt2xMTE//6178OGjSIiBYvXvzSSy/NnDlz2rRpZ8+e/fDDD1NSUhYtWmQ2mxGxoz+EwR2Jo         <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>The search optimization service can significantly improve the performance of certain types of lookup and analytical queries that use an extensive set of predicates for filtering.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Selective point lookup queries on tables. A point lookup query returns only one or a small number of distinct rows.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Once you identify the queries that can benefit from the search optimization service,&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>you can configure search optimization for the columns and tables used in those queries.&lt;/span>&lt;/p>&lt;/body>">

    <g id="273" ed:height="24" ed:parentid="268" transform="matrix(1,0,0,1,1020.8,1929.74)" ed:width="221.9375">
        <text class="st12">
            <tspan textLength="156" x="10" y="17.5" style="white-space:pre">SOS: Scenario-1(07:36)</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>In this lecture we will take an example and try to explain how SOS works in snowflake.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We will add SOS on a table and query the data. Eventually it will take less time.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>When SOS is not added then it will take more time.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>SOS will be helpful for pointed queries.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>SOS will be helpful if you are trying to query data of bigger volume and fetch small number of records.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(193,5)" xlink:href="#imgnote"/>
        </g>

        </g>

        <g ed:note="&lt;body style=&quot; font-family:'Microsoft YaHei'; font-size:12pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>We will revice on,&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>The search optimization service can significantly improve the performance of certain types of lookup and analytical queries that use an extensive set of predicates for filtering.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Selective point lookup queries on tables. A point lookup query returns only one or a small number of distinct rows.&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Comic Sans MS'; font-size:10pt;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>Once you identify the queries that can benefit from the search optimization service,&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Comic Sans MS'; font-size:10pt;&quot;>you can configure search optimization for the columns and tables used in those queries.&lt;/span>&lt;/p>&lt;/body>">
